import discoveryImage from '../images/imageDiscovery.svg';
import ticketsImage from '../images/imageTickets.svg';
import homeImage from '../images/imageHome.svg';
import qrcodeImage from '../images/imageQrcode.svg';
import imageInformations from '../images/imageInformations.svg';

const dictNavigationBarIcon = {
    'discovery': discoveryImage,
    'tickets': ticketsImage,
    'home': homeImage,
    'qrcode': qrcodeImage,
    'informations': imageInformations,
};


export {dictNavigationBarIcon};
